import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar">
      <h1>PiggyBank</h1>
      <div>
        <Link to="/">Home</Link>
        <Link to="/transactions">Transactions</Link>
        <Link to="/deposit">Deposit</Link>
      </div>
    </nav>
  );
}

export default Navbar;
